import React, { Component } from 'react';

class PlayerChevron extends Component {

    render() { 
        return ( 
            <Card style={{ width: '18rem' }}>
                <Card.Body>
                    <Card.Title>{this.props.userid}</Card.Title>
                    <Card.Text>
                        {this.props.balance}
                    </Card.Text>
                </Card.Body>
            </Card>

         );
    }
}

export default PlayerChevron;
